import React, { useEffect } from 'react';
import Toolbar from '../components/toolbar/toolbar';
import UserPhotos from '../components/userPhotos/UserPhotos';
import Collections from '../components/collections/collections';

function ProfilePage(props) {
  if (props.location.state === undefined) {
    return (
      <React.Fragment>
        <Toolbar />
        <h1>Nothing found</h1>
      </React.Fragment>
    );
  } else {
    const displayMyProfile =
      localStorage.getItem('userID') == props.location.state.id ? true : false;

    console.log(
      `ProfilePage - props.location.state is ${props.location.state.id}`
    );
    return (
      <React.Fragment>
        <Toolbar />
        {displayMyProfile ? null : (
          <Collections userID={props.location.state.id} />
        )}
        <UserPhotos userID={props.location.state.id} />
      </React.Fragment>
    );
  }
}

export default ProfilePage;
